export default function mapbooking() {
  return (
    <>
      <div>
        {tabledata
          .filter((event) => event.id === 2)
          .map((data) => (
            <div key={data.id}>
              <li>{data.pick_up_address}</li>
              {data.booking_drop_off_location.map((data) => (
                <li>{data.drop_off_address}</li>
              ))}
            </div>
          ))}
      </div>
    </>
  );
}
